#include "tools.h"

using namespace std;

void printLook();
void printMan();
string getKey();
string getPrize();
void openChest();


int main(int argc, const char * argv[]) {
    
    if (argc == 2){
        
        string arg = string(argv[1]);
        
        if (arg == "-man"){
            printMan();
            return 0;
        }
        if (arg == "-look"){
            printLook();
            return 0;
        }
        
        
        string inputFilePath = argv[1];
        
        if ( pathLeadsToFile(inputFilePath)){
            string encoding = convertFileToIntList(inputFilePath, false);
            if (encoding == getKey()){
                cout<<"The chest opens up, revealing its contents. As it does, the chest fades into the mist."<<endl;
                openChest();
                
            }else{
                cout<<"that key does not fit the lock"<<endl;
            }
        }else{
            cout<<"you did not specify a file"<<endl;
        }
        
        return 0;
        
    }
    
    showBadInputMessage();
    
    return 0;
}

void openChest(){
    
    //produce the "you win" screen"
    char * bytes = convertIntListToBytes( getPrize() );
    string targetFileName = getProcessDir() + "/you_win.png";
    ofstream myfile (targetFileName);
    if (myfile.is_open())
    {
        for (int i=0; i<6092; i++){     //this number was aitained when I converted the file to a string of ints
            myfile << bytes[i];
        }
        myfile.close();
    }
    delete[] bytes;
    
    //and kill the chest
    deleteSelf();
    
}


void printMan(){
    cout<<endl;
    cout<<"A Chest"<<endl<<endl;
    cout<<"A treasure chest in the middle of town"<<endl<<endl;
    cout<<"Usage:"<<endl;
    cout<<"chest [file]"<<endl<<"attempt to open the chest"<<endl<<endl;
    cout<<"chest -look"<<endl<<"look at the chest"<<endl<<endl;
}

void printLook(){
    cout<<"The chest is made of wood. The lock appears to be very sturdy."<<endl;
}


